import React, { Component } from "react";
import "./App.css";
import { Container, Badge, Table, Button } from "reactstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Items from "./scenes/Items";
import Stocks from "./scenes/Stocks";
import Transactions from "./scenes/Transactions";
import Units from "./scenes/Units";
class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Container>
        <Router>
          <div>
            <h1>
              Inventory <Badge color="secondary">APPS</Badge>
            </h1>
            <Switch>
              <Route path="/" exact component={Home} />
              <Route
                className="items-app"
                path="/Items"
                exact
                component={Items}
              />
              <Route
                className="units-app"
                path="/Units"
                exact
                component={Units}
              />
              <Route
                className="transactions-app"
                path="/Transactions"
                exact
                component={Transactions}
              />
              <Route
                className="stocks-app"
                path="/Stocks"
                exact
                component={Stocks}
              />
              <Route component={NotFound} />
            </Switch>
          </div>
        </Router>
      </Container>
    );
  }
}

function NotFound() {
  return <h2>NotFound</h2>;
}

export default App;
